import {
    createBrowserRouter,
    createRoutesFromElements,
    Route
} from "react-router-dom";
import App from "./App";
const router = createBrowserRouter(
    createRoutesFromElements(
        <>
            <Route path="/" element={<App />} >
                <Route index={true} element={<Body />} loader={ BodyLoader }/>
                <Route path="*" element={<Body />} loader={ BodyLoader }/>
            </Route>
        </>
    )
);

export default router;
